import "./App.css";
import React from "react";
import CodePanel from "./components/CodePanel";
import ListPanel from "./components/ListPanel";

function App() {
  return (
    <div className="App">
      <CodePanel />
      <ListPanel />
    </div>
  );
}

export default App;
